import React from "react"

function Main()
{
    return(
        <React.Fragment>
            <div className="mainbody">
          <h2 className="myname">Nandini Midde</h2>
          <h4 className="mywork">Astronaut</h4>
          <div className="buttons">
          <input className="emailbutton" type="button" name="Email"  value={'Email'} />
          <input className="gitbutton" type="button" name="Git"  value={'GitHub'} />
          </div>
          </div>

        </React.Fragment>
    )
        


}
export default Main;
